activity.description:
&lt;p&gt;
					New South Wales is a climate change hotspot where the ocean is warming three times the global average and becoming more acidic due to increased CO2. The region&amp;rsquo;s marine resources and associated industries are vulnerable to climate change if species are unable to adapt. Multigenerational experiments with key marine invertebrates reared in near future projected ocean change conditions will determine the potential for adaptation to climate change stressors over successive generations. The outcomes will inform resource managers, industry and the community as they plan, prepare for and work to minimise the impacts of climate change on our marine resources.&lt;/p&gt;
				&lt;p&gt;
					This project was developed to fill knowledge gaps that hinder robust prediction about the effects of climate change on NSW&amp;rsquo;s marine fauna. We address a serious paucity of knowledge on the interactive effects of ocean acidification and warming across entire life histories of ecologically important marine animals and, most importantly, the potential for adaptation to ocean change over multiple generations. Our multidisciplinary team (NMSC, USyd, UNSW, DECCW) has extensive experience in climate change impacts on marine invertebrates, the ecology and evolution of focal taxa (sea urchins, crustaceans) and assessment of adaptive potential in the face of ocean change and other anthropogenic stressors. The infrastructure for manipulation of temperature and pH is in place in an established automatic CO2 injection flow through seawater facility at the NMSC.&lt;/p&gt;
				&lt;p&gt;
					&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;Different Sights&lt;/em&gt; aims to texture public representations of heritage in New England and to enrich the history of the region through documenting and narrating the histories of immigrants who came from non-English-speaking backgrounds and whose experiences offer different perspectives on aspects of the region’s history. To achieve this, the project has looked beyond recognized and advertised heritage sites, called on the assistance and stories of local residents and families, recognized the significant contributions of local museums and historical societies, and used the modern historian’s recognition of the rich range of sources for piecing together the past.&lt;/p&gt;
				&lt;p&gt;Research has entailed field visits, archival investigations and oral history interviews.&lt;/p&gt;
				&lt;p&gt;The Heritage Futures online database has provided the framework for collating and updating the research, and presenting the data.&lt;/p&gt;
				&lt;p&gt;Other outcomes include the publication of a thematic history that draws on the data collection.&lt;/p&gt;

