				&lt;p&gt;&lt;a href=&quot;http://www.ccrc.unsw.edu.au/NARCliM&quot;&gt;The New South Wales and Australian Capital Territory Regional Climate Model (NARCliM) project&lt;/a&gt; is developing new, fine-scale climate projections for New South Wales (NSW) and the Australian Capital Territory (ACT) using a regional climate model.&lt;/p&gt;
				&lt;p&gt;NARCliM is funded through a consortium of project partners including:&lt;/p&gt;
				&lt;ul&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.environment.nsw.gov.au/&quot;&gt;NSW Government Office of Environment and Heritage&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.ccrc.unsw.edu.au/&quot;&gt;University of New South Wales Climate Change Research Centre (CCRC)&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.environment.act.gov.au/&quot;&gt;ACT Government Environment and Sustainable Development Directorate&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.sydneywater.com.au/&quot;&gt;Sydney Water&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.sca.nsw.gov.au/&quot;&gt;Sydney Catchment Authority&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.hunterwater.com.au/&quot;&gt;Hunter Water&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.transport.nsw.gov.au/&quot;&gt;NSW Government Department of Transport&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.dpi.nsw.gov.au/&quot;&gt;NSW Government Department of Primary Industries&lt;/a&gt;&lt;/li&gt;
				&lt;li&gt;&lt;a href=&quot;http://www.water.nsw.gov.au/&quot;&gt;NSW Government Office of Water&lt;/a&gt;&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;NARCliM aims to improve projections of future changes in temperature, wind and rainfall across NSW and the ACT and hence provide information for managing the impacts of climate change on health, settlements, agriculture, weather extremes and services, such as water and energy supplies.&lt;/p&gt;
				&lt;p&gt;NARCliM uses the &lt;a href=&quot;http://www.wrf-model.org/index.php&quot;&gt;Weather Research and Forecasting (WRF) regional climate model&lt;/a&gt;, a dynamical regional climate model that gives high resolution projections of temperature, rainfall and many other meteorological variables.&lt;a href=&quot;http://www.agu.org/pubs/crossref/2010/2010JD013816.shtml&quot;&gt; WRF has been demonstrated to be effective in simulating temperature and rainfall in NSW&lt;/a&gt; and provides a good representation of local topography and coastal processes. It has been jointly developed by several major weather and research centres in the United States and is widely used internationally.&lt;/p&gt;
				&lt;p&gt;There are four components to the NARCliM project.&lt;/p&gt;
				&lt;p&gt;&lt;strong&gt;Modelling&lt;/strong&gt;&lt;/p&gt;
				&lt;p&gt;The modelling component is mainly being run and supervised at the &lt;span class=&quot;external&quot;&gt;CCRC&lt;/span&gt;. The modelling effort will culminate in projections being produced for several climate variables, including temperature, rainfall, wind, relative humidity, sea surface temperature and soil temperature.&lt;/p&gt;
				&lt;p&gt;&lt;strong&gt;Data storage&lt;/strong&gt;&lt;/p&gt;
				&lt;p&gt;NARCliM will generate a very large dataset, estimated to be at least 1 petabyte in size (1 million gigabytes), which will be systematically managed by the NSW Government Office of Environment and Heritage.&lt;/p&gt;
				&lt;p&gt;&lt;strong&gt;Data retrieval and access&lt;/strong&gt;&lt;/p&gt;
				&lt;p&gt;NARCliM is designed to give the community easy access to both raw climate model data and, more importantly, information that combines the model projections into climate statistics that can be readily used by the public and agencies like local government. Inquiry, summary and visualisation tools are being developed using feedback from a user reference group. This will include tools to calculate fire weather hazard or extreme events, such as flood risk.&lt;/p&gt;
				&lt;p&gt;&lt;strong&gt;Synthesis reports&lt;/strong&gt;&lt;/p&gt;
				&lt;p&gt;A report synthesising and interpreting the projected changes in climate across NSW will be jointly completed by staff from the NSW Government Office of Environment and Heritage and the CCRC.&lt;/p&gt;
				&lt;p&gt; &lt;/p&gt;

