&lt;div&gt;
					This study addressing the spiritual dimension of learning resulted in the development of a learning approach that addressed the complementarity of cognitive, affective and spiritual learning. Within these dimensions four elements were identified in the learning process.&amp;nbsp;&lt;/div&gt;
				&lt;ul&gt;
					&lt;li&gt;
						Perception/Sensing&lt;/li&gt;
					&lt;li&gt;
						Cognitive: thinking (conscious mind)&lt;/li&gt;
					&lt;li&gt;
						Affective: feeling &amp;nbsp;(conscious and nonconscious mind)&lt;/li&gt;
					&lt;li&gt;
						Spiritual: intuiting, Imagining, Creating &amp;nbsp;(nonconscious mind)&lt;/li&gt;
				&lt;/ul&gt;
				&lt;div&gt;
					&lt;span style="font-size: 12px;"&gt;The research evolved into a study of intuitions and intuitive learning and the unconscious mind which led to a discussion of the role of nonconscious learning.&lt;/span&gt;&lt;/div&gt;

