				&lt;div&gt;
					The project consisted of two phases. &amp;nbsp;Phase One was from 2006-7 and created links between two K-12 schools and &amp;nbsp;five primary schools in NSW and ACT . &amp;nbsp;During this phase a questionnaire was administered to ascertain current knowledge of teachers; teachers participated in focus group discussion; and lessons were observed by researchers. &amp;nbsp; An extensive review of the literature was conducted. &amp;nbsp;Phase Two built on the research commenced in Phase One. &amp;nbsp;Teachers who participated in Phase One mentored teachers from Phase Two. &amp;nbsp;Phase Two saw the involvment of 30 teachers from three rural schools who had recently introduced interactive whiteboards (IWB) into their classroom. &amp;nbsp;Semi-focussed interviews were conducted with teachers and students.&amp;nbsp;&lt;br /&gt;
