&lt;div&gt;
					This research study sought to explore young Copts&amp;rsquo; perceptions of their own religiosity and spirituality, their sense of identity and their links to their religious tradition.&lt;/div&gt;
				&lt;div&gt;
					&lt;span style="font-size: 12px;"&gt;Given the secular and pluralistic context of Australian society, and the relationship many young Australians have with mainstream religious traditions, as discussed earlier, this research study was interested to investigate the perceptions of the younger members of a small ethnic community in Australia of their religious heritage and identity.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;
				&lt;div&gt;
					&lt;span style="font-size: 12px;"&gt;Therefore, this research project focused specifically on the Melbourne Coptic community where the first Australian Coptic bishop was appointed in the late nineties. Arguably, such an appointment has had a significant impact on the further development of the identity and structure of the Coptic community in Australia, and particularly in Melbourne.&lt;/span&gt;&lt;/div&gt;
