The aim of the project is to use ANSTO's nuclear-based technologies and analytical capabilities to study how the Earth's climate systems have changed, and how the land surface interacts with the atmosphere. This research is supported by ANSTO's world-class ANTARES and STAR accelerators, applying Accelerator Mass Spectrometry (AMS) techniques in radiocarbon dating and exposure age dating. The project has two key tasks:&#13;
				&#13;
				Cosmogenic Climate Archives of the Southern Hemisphere (CcASH) &#13;
				Initial Year: 2005&#13;
				Project Status: Proceeding See larger image Cosmogenic Climate Archives of the Southern Hemisphere (CcASH) is an ANSTO initiative aimed at enhancing our understanding of past climate variability and environmental conditions in Australasia and Antarctica. Within the CcASH task there are three major themes of research activity with specific sub tasks: &#13;
				-    Glacial and Sedimentary Systems&#13;
				-    Atmospheric and Oceanic Radiocarbon Systems&#13;
				-    Ice Sheets and Micro-carbon Studies Atmospheric Mixing and Pollution Transport (AMPT):&#13;
				The Atmospheric Mixing and Pollution Transport group uses naturally-occurring radioactive and stable isotope tracers to investigate  and understand the sources and movement of pollution and greenhouse gases in the lower atmosphere. ANSTO's atmospheric research group has strong national links to the Australian Bureau of Meteorology and the Commonwealth Scientific and Industrial Research Organisation (CSIRO). International collaborations include involvement in the WMO Global Atmosphere Watch Program, the European and North American Carbon Programs, and the GEWEX modelling community.

Nuclear Methods in Earth Systems uses isotopic and nuclear techniques to trace the impact of humans on the environment. Earth systems science recognises that knowledge of the history of environmental variability and human-environment interactions improves our understanding of the functioning of Earth systems and their response, or vulnerability, to current and future impacts. The techniques and instruments used by researchers in this group enable them to reconstruct human impacts on ecosystems over the past 8000 years. The Nuclear Methods in Earth Systems group have formed partnerships and collaborations with many of the worlds leading research institutes, and undertake fieldwork on sites around Australia, and the world. Study areas include:&#13;
				&#13;
				- Tracing Human Impacts on Earth Systems &#13;
				- Contaminant Science &#13;
				- Nuclear Methods in the Carbon Cycle
